  def('get',
      {a: [Accessible]},
      [TypeRep, $.String, a, $Maybe(b)],
      function(type, key, obj) { return filter(is(type), Just(obj[key])); });

  //# gets :: Accessible a => TypeRep b -> Array String -> a -> Maybe b
  //.
